    <div>
    <p class=MsoNormal align=center style='text-align:center'><span
    style='font-family:"Arial",sans-serif;color:#4D5156;background:white'>Europa&nbsp;</span><span
    style='font-family:"Arial",sans-serif;color:#040C28;background:#D3E3FD'>es
    uno de los seis continentes del mundo<span style='font-variant-ligatures: normal;
    font-variant-caps: normal;orphans: 2;text-align:start;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'></span><span
    style='font-family:"Arial",sans-serif;color:#4D5156;background:white'>. Los
    otros son frica, Amrica, Antrtida, Asia y Oceana. Europa se extiende
    desde el rtico, en el norte, al mar Mediterrneo, en el sur, y desde el
    ocano Atlntico, en el oeste, hasta las montaas de los Urales (en Rusia),
    en el este.</span></span><span style='font-size:16.0pt;line-height:106%;
    font-family:"Wide Latin",serif;color:red'><o:p></o:p></span></p>
    </div>
